export default function Uplot() {
  const [timeRange, setTimeRange] = React.useState("90d")
  const [selectedKeys, setSelectedKeys] = React.useState(Object.keys(chartConfig))
  const [loadedKeys, setLoadedKeys] = React.useState(Object.keys(chartConfig))
  const [yAxisMax, setYAxisMax] = React.useState(undefined)
  const [viewMode, setViewMode] = React.useState('chart')
  
  const chartRef = React.useRef(null)
  const plotRef = React.useRef(null)

  // Filter data based on time range and zoom
  const filteredData = React.useMemo(() => {
    let filtered = chartData.filter((item) => {
      const date = new Date(item.date)
      // const referenceDate = new Date("2024-06-30")
      // let daysToSubtract = 90
      // if (timeRange === "30d") daysToSubtract = 30
      // else if (timeRange === "7d") daysToSubtract = 7
      // const startDate = new Date(referenceDate)
      // startDate.setDate(startDate.getDate() - daysToSubtract)
      // return date >= startDate
      return date;
    })

    return filtered
  }, [timeRange, viewMode])

  // Convert data to uPlot format
  const getUPlotData = React.useCallback(() => {
    const timestamps = filteredData.map(d => new Date(d.date).getTime() / 1000)
    const data = [timestamps]
    loadedKeys.forEach(key => data.push(filteredData.map(d => d[key])))
    return data
  }, [filteredData, loadedKeys])

  const getUPlotOptions = React.useCallback(() => {
    const series = [{}] // First series is always the x-axis (time)
    
    Object.keys(chartConfig).forEach(key => loadedKeys.includes(key) ? series.push(
      {
        label: chartConfig[key].label,
        stroke: chartConfig[key].color,
        width: 1,
        show: true,
      }
    ): null)

    return {
      // id: 'my-chart',
      width: chartRef.current?.clientWidth || 600,
      // class: ["selection:bg-fuchsia-300", "selection:text-fuchsia-900", "h-[300px]"],
      // class: "uplot-styles",
      padding: [10,0,0,10],
      height: 400,
      series,
      legend: {
        show: false
      },
      scales: {
        x: {
          time: true,
        },
        y: {
          range: yAxisMax ? [0, yAxisMax] : [null, null]
        }
      },
      axes: [
        {
          stroke: "#64748b",
          grid: {
            show: false,
            stroke: "#e2e8f0",
            width: 1
          }
        },
        {
          stroke: "#64748b",
          grid: {
            show: false,
            stroke: "#e2e8f0",
            width: 1,
          },
          values: (u, vals) => vals.map(v => v.toExponential(1)),
        }
      ],
      cursor: {
        show: true,
        x: true,
        y: true,
        lock: false,
      },
      select: {
        show: true,
        over:true,
        left: 0,
        width: 0,
        top: 0,
        height: 0,
      },
      hooks: {
        setCursor: [plot => {
          let idx = plot.cursor.idx;
          document.getElementById("timestamp").innerHTML = filteredData[idx]?.date.toString() || ""
          Object.keys(chartConfig).forEach(key => {
            const elem = document.getElementById(`id-${key}`);
            elem.innerHTML = filteredData[idx]?.[key].toString() || ""
          });
        }],
        setSelect: [
          plot => {
            console.log(plot)
          }
        ]
      }
    }
  }, [loadedKeys, yAxisMax])

  // Handle chart creation and updates
  React.useEffect(() => {
    if (!chartRef.current) return

    const data = getUPlotData()
    const options = getUPlotOptions()

    // Destroy existing plot
    if (plotRef.current) {
      plotRef.current.destroy()
      plotRef.current = null
    }

    // Clear the container
    if (chartRef.current) {
      chartRef.current.innerHTML = ''
    }

    try {
      // Create new plot
      plotRef.current = new uPlot(options, data, chartRef.current)
      console.log('uPlot created successfully')
    } catch (error) {
      console.error('Error creating uPlot:', error)
    }

    // Cleanup function
    return () => {
      if (plotRef.current) {
        plotRef.current.destroy()
        plotRef.current = null
      }
    }
  }, [getUPlotData, getUPlotOptions])

  // Handle window resize
  React.useEffect(() => {
    const handleResize = () => {
      if (plotRef.current && chartRef.current) {
        plotRef.current.setSize({
          width: chartRef.current.clientWidth,
          height: 300
        })
      }
    }

    window.addEventListener('resize', handleResize)
    return () => window.removeEventListener('resize', handleResize)
  }, [])

  return (
    <Card className="p-0 col-span-2 border-none shadow-none">
      <CardHeader className="flex items-center gap-2 space-y-0 py-1 sm:flex-row px-2 border-b">
        <div className="flex gap-2 items-center">
          <div className="flex items-center gap-2">
            <Label htmlFor="yaxis-max" className="text-sm">Y-axis max</Label>
            <Input
              id="yaxis-max"
              type="number"
              placeholder="Auto"
              value={yAxisMax || ''}
              onChange={(e) => setYAxisMax(e.target.value ? Number(e.target.value) : undefined)}
              className="w-20 h-8"
            />
          </div>
          <div className="flex rounded-md border">
            <Button
              variant={viewMode === 'chart' ? 'default' : 'ghost'}
              size="sm"
              onClick={() => setViewMode('chart')}
              className="rounded-r-none h-8"
            >
              <BarChart3 size={16} />
            </Button>
            <Button
              variant={viewMode === 'table' ? 'default' : 'ghost'}
              size="sm"
              onClick={() => setViewMode('table')}
              className="rounded-l-none h-8"
            >
              <TableIcon size={16} />
            </Button>
          </div>
          <Select value={timeRange} onValueChange={setTimeRange}>
            <SelectTrigger className="hidden w-[160px] rounded-lg sm:ml-auto sm:flex">
              <SelectValue placeholder="Last 3 months" />
            </SelectTrigger>
            <SelectContent className="rounded-xl bg-background">
              <SelectItem value="90d">Last 3 months</SelectItem>
              <SelectItem value="30d">Last 30 days</SelectItem>
              <SelectItem value="7d">Last 7 days</SelectItem>
            </SelectContent>
          </Select>
        </div>
      </CardHeader>

      <CardContent className="p-0 overflow-auto">
        {viewMode === 'chart' ? (
          <div className="grid grid-cols-4 gap-2 relative">
            <div className="col-span-3 p-2">
              <div ref={chartRef} className="w-auto h-auto" />
                <div className="text-xs text-muted-foreground absolute bottom-0 left-0 p-2">
                  💡 Click and drag to zoom • Double-click to reset zoom
                </div>
            </div>
            <div className="col-span-1 flex flex-col justify-between border-l p-2">
              <div className="space-y-4">
                <div className="text-sm text-muted-foreground font-medium flex justify-between items-center">
                  {/* {hoverData?.date || "Hover over chart"} */}
                  <span>Timestamp</span>
                  <span id="timestamp">time</span>
                </div>

                <div>
                  {Object.entries(chartConfig).map(([key, { label, color }]) => {
                    const checked = selectedKeys.includes(key)
                    const isLoaded = loadedKeys.includes(key)
                    return (
                      <label key={key} className="flex items-center justify-between transition-colors p-1 rounded">
                        <div className="flex items-center space-x-2 cursor-pointer">
                          <Checkbox
                            checked={checked}
                            onCheckedChange={(checked) => {
                              setSelectedKeys((prev) =>
                                checked ? [...prev, key] : prev.filter((k) => k !== key)
                              )
                            }}
                          />
                          <span className="font-normal text-sm lowercase break-words" style={{ color }}>{label}</span>
                        </div>
                        <span className={`text-xs font-normal text-muted-foreground ${checked && isLoaded ? "visible": "invisible"}`} id={`id-${key}`}></span>
                      </label>
                    )
                  })}
                </div>
              </div>

              <div className="space-y-2">
                <button
                  onClick={() => setLoadedKeys([...selectedKeys])}
                  disabled={JSON.stringify(loadedKeys) === JSON.stringify(selectedKeys) || !selectedKeys.length}
                  className="w-full rounded bg-primary text-white px-4 py-2 hover:bg-primary/90 disabled:opacity-50 disabled:cursor-not-allowed text-sm"
                >
                  Load
                </button>
              </div>
            </div>
          </div>
        ) : (
        //   <div className="p-2 block" id="table-container">
            <VirtualTabularData headers={["Date", ...Object.keys(chartConfig).map(key => chartConfig[key].label)]} data={filteredData}/>
        //   </div>
        )}
      </CardContent>
    </Card>
  )
}